export const AppContext = createContext({});

const AppProvider = ({ children }) => {

    const findProductById = (id) => {
        return products.find(product => product.id === +id) // y c th  l poduct.id == id v id (ci id c ngoc hng) nhn vo n dng chui m ci id == id kia l dng s  ,  mun  === th thm du +  i li thnh dng s ok

    };

    
    return (
        <AppContext.Provider value={{ products, findProductById }}>
            {children}
        </AppContext.Provider>
    )
}

export default AppProvider;